    const [geoCode, setGeoCode] = useState('');

    return(
        <>
            <div>
                <Form getGeoCode={selected => setGeoCode(geoCode.value)}/>
                <Graph geoCode={geoCode} />     
            </div> 
        </>
    );

}

export default MainPage
